import React from "react";
import { Route } from 'react-router-dom';

class Main extends React.Component {

  handleClick = () => {
    <Route exact path ={this.props.name} element={<Button1 />}/>
  }

  render() {
    return (
      <div class="container">

        <div class="row">
          <h1 className="font">Overview</h1>
        </div>

        <div class="row" >
          <div class="col" className="top">
            <button className="butts" name="button1" onClick={this.handleClick} >bouton1</button>
            <button className="butts" >bouton2</button>
            <button className="butts" >bouton3</button>
            <button className="butts" >bouton4</button>
          </div>
        </div>

        <div class="row">
          <div className="mid">
            <article>
              yo
            </article>
          </div>
        </div>



      </div>
    );
  }
}

export default Main;
